import React from 'react'

const Country = ({ name, population, continent, area }) => {
    return (

        <div className='oneCountry'>
            <span>{name}</span>
            <span>{population}</span>
            <span>{continent}</span>
            <span>{area}</span>
            </div>
    )
}
export default Country;
